import React from 'react'
import Linkedin from '../img/icons/link.png'

const Footer = () => {
  return (

    <div className='footer--container'>

        <p> Footer </p>

        <div className='footer-icons'>
            <img src={Linkedin} alt="Linkedin"></img>
        </div>

    </div>
  )
}

export default Footer
